import React from "react";

class Category extends React.Component {
  state = {
    selected: false
  };

  render() {
    const { filter, categories } = this.props;

    return (
      <div className="categories">
        <h5>Category filter</h5>
        {categories.map(c => {
          return <button>{c}</button>;
        })}
      </div>
    );
  }
}

export default Category;
